}

getCount();
  `.trim();


  const strStr = `
  const strStr = function (haystack, needle) {
    const base = 256
    const prime = 1439173969
    if (needle === '') {
      return 0
    }
    let hashNeedle = 0
    const magic = (base ** (needle.length - 1)) % prime
    const product = prime * base
    for (const c of needle) {
      hashNeedle = (hashNeedle * base + c.charCodeAt(0)) % prime
    }
    const isEqual = i => needle === haystack.slice(i, i + needle.length)
    let hash = 0
    for (let i = 0; i <= haystack.length - needle.length; i++) {
      if (i === 0) {
        for (let j = 0; j < needle.length; j++) {
          hash = (hash * base + haystack[j].charCodeAt(0)) % prime
        }
      } else {
        hash = (hash - haystack[i - 1].charCodeAt(0) * magic + product) % prime
        hash = (hash * base + haystack[i + needle.length - 1].charCodeAt(0)) % prime
      }
      if (hash === hashNeedle && isEqual(i)) {
        return i
      }
    }
    return -1
  }

  console.log(strStr(haystack = "hello", needle = "ll"))`.trim();



const combinations = `
  function perm(str){
    var results = [];
    var arr = str.split("");
    var len = Math.pow(arr.length, 2);

    for( var i = 0; i < len; i++ ){
      for(var j=i; j>>=1;){
      for( var k= 0; k < arr.length; k++){
        arr[k] = ( j & 1 ) ? arr[k].toUpperCase() : arr[k].toLowerCase();
      }
    }
      var combo = arr.join("");
      results.push(combo);
    }
    return results;
  }

console.log( perm("ab"));`.trim();

const maxLength = `
const maxLength = function (arr) {
  let max = 0
  const isUnique = (s = '') => {
    const map = {}
    for (const c of s) {
      map[c] = (map[c] || 0) + 1
      if (map[c] >= 2) {
        return false
      }
    }
    return true
  }
  const aux = (index, current = '') => {
    if (index > arr.length - 1) {
      max = Math.max(current.length, max)
      return
    }
    if (isUnique(current)) {
      aux(index + 1, current)
      if (isUnique(current + arr[index])) {
        aux(index + 1, current + arr[index])
      }
    }
  }
  aux(0)
  return max
}

console.log(maxLength(["un","iq","ue"]))`.trim();


const isIsomorphic = `
const isIsomorphic = (s, t = '') => {
  const count = str => Array.prototype.reduce.call(str, (map, c, index) => {
    if (map[c]) {
      map[c].push(index)
    }
    map[c] = [index]
    return map
  }, {})
  const mapS = count(s)
  const mapT = count(t)

  for (let i = 0; i < s.length; i++) {
    const charS = s[i]
    const charT = t[i]
    for (let j = 0; j < mapS[charS].length; j++) {
      if (mapS[charS][j] !== mapT[charT][j]) {
        return false
      }
    }
  }
  return true
}


console.log(isIsomorphic("egg", "add"))`.trim();

const wordBreak = `
const wordBreak = (s, wordDict = []) => {
  const memo = {}
  const aux = (current = '') => {
    if (memo[current] !== undefined) {
      return memo[current]
    }
    if (current === s) {
      return true
    }
    if (s.indexOf(current) === -1) {
      return false
    }
    memo[current] = wordDict.some(word => aux(current + word))
    return memo[current]
  }
  return aux('')
}

console.log(wordBreak("leetcode", wordDict = ["leet", "code"]))`.trim();

const twoSum = `
const twoSum = (nums, target) => {
  const memo = {}
  const aux = (index) => {
    if (memo[nums[index]] !== undefined) {
      return [memo[nums[index]], index]
    }
    memo[target - nums[index]] = index
    return aux(index + 1)
  }
  return aux(0, nums.length - 1)
}

console.log(twoSum([2,7,11,15],18))`.trim();

const addTwoNumbers = `
function ListNode(val) {
  this.val = val
  this.next = null
}

const addTwoNumbers = (l1, l2) => {
  let h1 = l1
  let h2 = l2
  let digit = 0
  let head = null
  let current = null
  while (h1 || h2) {
    const num1 = h1 ? h1.val : 0
    const num2 = h2 ? h2.val : 0
    let value = num1 + num2 + digit
    if (value >= 10) {
      value -= 10
      digit = 1
    } else {
      digit = 0
    }
    h1 = h1 ? h1.next : null
    h2 = h2 ? h2.next : null
    const node = new ListNode(value)
    if (!head) {
      head = node
      current = node
    } else {
      current.next = node
      current = node
    }
  }
  if (digit === 1) {
    current.next = new ListNode(1)
  }
  return head
}


console.log(addTwoNumbers())`.trim();

const lengthOfLongestSubstring = `
const lengthOfLongestSubstring = (s = '') => {
  const map = {}
  let max = 0
  let left = -1
  for (let i = 0; i < s.length; i++) {
    if (map[s[i]] !== undefined) {
      left = Math.max(left, map[s[i]])
      max = Math.max(i - left, max)
    } else {
      max = Math.max(i - left, max)
    }
    map[s[i]] = i
  }
  return max
}


console.log(lengthOfLongestSubstring("pwwkew"))`.trim();

const ladderLength = `
const ladderLength = function (beginWord, endWord = '', wordList = []) {
  const distance = (a = '', b = '') => {
    let count = 0
    for (let index = 0; index < b.length; index++) {
      if (a[index] !== b[index]) {
        count += 1
      }
    }
    return count === 1
  }
  let current = [beginWord]
  const visited = {
  }
  let count = 1
  while (current.length > 0) {
    const next = []
    for (const word of current) {
      if (word === endWord) {
        return count
      }
      if (!visited[word]) {
        next.push(...wordList.filter(word2 => distance(word, word2) && !visited[word2]))
      }
      visited[word] = true
    }
    count += 1
    current = next
  }
  return 0
}

console.log(ladderLength("hit", "cog", ["hot","dot","dog","lot","log","cog"]))`.trim();

const findMedianSortedArrays = `
const findMedianSortedArrays = (nums1, nums2) => {
  const merge = (xs1, xs2) => {
    if (!xs1 || !xs1.length) {
      return xs2
    }
    if (!xs2 || !xs2.length) {
      return xs1
    }
    const [hd1, ...rest1] = xs1
    const [hd2, ...rest2] = xs2
    return hd1 <= hd2 ? [hd1, ...merge(rest1, xs2)] : [hd2, ...merge(xs1, rest2)]
  }
  const nums = merge(nums1, nums2)
  const middle = Math.floor((nums.length-1) / 2)

  return (middle * 2 === (nums.length-1)) ?  nums[middle] : ((nums[middle] + nums[middle + 1]) / 2) 
}


console.log(findMedianSortedArrays([1,2],[3,4]))`.trim();

const longestPalindrome = `
const longestPalindrome = (s = '') => {
  const memo = {}
  const isPalindrome = (left, right) => {
    if (left === right) {
      return true
    }
    for (let i = left; i <= Math.floor((left + right) / 2); i++) {
      if (s[i] !== s[right - i + left]) {
        return false
      }
    }
    return true
  }
  const aux = (left, right) => {
    if (left > right) {
      return ''
    }
    memo[left] = memo[left] || {}
    if (memo[left][right] !== undefined) {
      return memo[left][right]
    }
    if (isPalindrome(left, right)) {
      return s.substring(left, right + 1)
    }
    memo[left][right] = aux(left + 1, right).length > aux(left, right - 1).length
      ? aux(left + 1, right)
      : aux(left, right - 1)
    return memo[left][right]
  }
  return aux(0, s.length - 1)
}

console.log(longestPalindrome("babad"))`.trim();

const convert = `
const convert = function (s, numRows) {
  if (numRows === 1) {
    return s
  }
  const arr = new Array(numRows).fill("")
  let i = 0
  let down = true
  for (const c of s) {
    arr[i] += c
    if (down) {
      i += 1
      if (i === numRows - 1) {
        down = false
      }
    } else {
      i -= 1
      if (i === 0) {
        down = true
      }
    }
  }
  return arr.join('')
}


console.log(convert("PAYPALISHIRING",3))`.trim();

const reverse = `
const reverse = function (x) {
  let max = (2 ** 31) - 1
  let min = - (2 ** 31)

  const isMinus = x < 0
  const str = String(Math.abs(x)).split('').reverse().join('')
  const result =  isMinus ? Number('-'$'{str}') : Number(str)
  if (result > max || result < min) {
    return 0
  }
  return result
}


console.log(reverse(123))`.trim();

const isPalindrome = `
const isPalindrome = function (x) {
  if (x < 0) {
    return false
  }
  let reverse = 0
  let num = x
  while (num > 0) {
    reverse = reverse * 10 + (num % 10)
    num = Math.floor(num / 10)
  }
  return reverse === x
}


console.log(isPalindrome(121)) `.trim();

const maxArea = `
const maxArea = (height = []) => {
  let max = 0
  let left = 0
  let right = height.length - 1
  while (left < right) {
    max = Math.max(max, Math.min(height[left], height[right]) * (right - left))
    if (height[left] <= height[right]) {
      left += 1
    } else {
      right -= 1
    }
  }
  return max
}

console.log(maxArea([1,8,6,2,5,4,8,3,7]))`.trim();


